const searchResult = (state = 0, action) => {
  switch (action.type) {
    case 'UPDATE_SEARCH_RESULT':
      state = action.success;
      // state.result = action.result;
      console.log(state)
      return state
    default:
      return state
  }
}

export default searchResult
